import "antd/dist/antd.css";
import MovieList from "./components /MovieList";
import Filter from "./components /Filter";
import Title from "./components /Title";
function App() {
  return (
    <div className="app">
      <Title />
      <Filter />
      <MovieList />
    </div>
  );
}
export default App;
